import React, { Component } from "react";
const RadioInput = ({ type, id, name, value, label }) => {
  return (
    <div>
      <label htmlFor={name} className="login_label">
        {label}
      </label>
      <input type={type} id={id} name={name} value={value} />;
    </div>
  );
};

export default RadioInput;
